import React, {Components} from "react";
import Background from "../backgroundComponent/Background";
import Header from "../headerComponent/Header";
import Area from "../areaComponent/Area";


function StartAnimation(props){
    return(
      <div>
          <Spring
              from={{ x: 100 }}
              to={{ x: 0 }}>
              {props => (
                  <svg strokeDashoffset={props.x}>
                      <Spring
                          from={{ x: 100 }}
                          to={{ x: 0 }}>
                          {props => (
                              <svg strokeDashoffset={props.x}>
                                  <path d="..." />
                              </svg>
                          )}
                      </Spring>
                  </svg>
              )}
          </Spring>
          <Background/>
          <Header/>
          <Area classes={{card: "4", media: "Hello", content: "ndawlndwalnidaw awdwadawd wadawd gregf"}}/>
      </div>
    );
}


export default StartAnimation;
